import React,{ Component } from 'react';  
import RegisterUser from './components/registerUsers';
import ShowUsers from "./components/showUsers";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dataFetched: false
    }
  }
  render() {
    return (
      <div className="App">
        <RegisterUser onSubmit={() => {
          this.setState({
            dataFetched: false
          })
        }}/>
        <ShowUsers isDataFetched={this.state.dataFetched} on/>
      </div>
    );
  }
}

export default App;
